DROP TABLE IF EXISTS `warehouse_info`;
CREATE TABLE `warehouse_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `warehouse_sn` varchar(255) NOT NULL COMMENT '仓库编码,input,NO,false,true,true',
  `warehoust_name` varchar(255) NOT NULL COMMENT '仓库名称,input,NO,false,true,true',
  `warehouse_phone` varchar(255) NOT NULL COMMENT '仓库电话,input,NO,false,true,false',
  `contact` varchar(255) NOT NULL COMMENT '仓库联系人,input,NO,false,true,true',
  `province` int(11) NOT NULL COMMENT '省,input,NO,false,true,true',
  `city` int(11) NOT NULL COMMENT '市,input,NO,false,true,true',
  `distrct` int(11) NOT NULL COMMENT '区,input,NO,false,true,true',
  `address` varchar(255) NOT NULL COMMENT '仓库地址,input,NO,false,true,true',
  `warehouse_status` int(11) NOT NULL COMMENT '仓库状态,input,NO,false,true,true',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` bigint(20) DEFAULT NULL COMMENT '创建人',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '修改人',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `del_flag` tinyint(4) DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='仓库信息表,1';

