DROP TABLE IF EXISTS `warehouse_product`;
CREATE TABLE `warehouse_product` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `product_id` bigint(20) NOT NULL COMMENT '商品ID,input,NO,false,true,false',
  `w_id` bigint(20) NOT NULL COMMENT '仓库ID,input,NO,false,true,false',
  `current_cnt` int(11) NOT NULL COMMENT '当前商品数量,input,NO,false,true,false',
  `lock_cnt` int(11) NOT NULL COMMENT '当前占用数据,input,NO,false,true,false',
  `in_transit_cnt` int(11) NOT NULL COMMENT '在途数据,input,NO,false,true,false',
  `average_cost` decimal(11,2) NOT NULL COMMENT '移动加权成本,input,NO,false,true,false',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` bigint(20) DEFAULT NULL COMMENT '创建人',
  `update_date` datetime DEFAULT NULL COMMENT '修改时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '修改人',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `del_flag` tinyint(4) DEFAULT NULL COMMENT '删除标记',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品库存表,1';

